import React, { useState } from "react";
import styles from './Community_Avatar.module.css';
import '../components/Community_Section';

export default function App_logo(props){
    const [isClicked,setisClicked] = useState(false);

    function communityClickHandler(){
        setisClicked(!isClicked);
    }

    return <div>
    <img onClick={communityClickHandler} className={styles.community_avatar} src={props.img} alt="" />

        {isClicked ?  <div>
        <Community_Section name="General"/>
        <Community_Section name="Mentors"/>
        <Community_Section name="Project discussion"/>
        <Community_Section name="Announcement"/> 
        </div> 
        :
        <Community_Section name="No Sections Found"/> }
    </div>;
}
